import Main from './components/Main';
import Footer from './components/Footer';
import './index.css'; 
import Header from './components/Header';



const App = () => {
    return (
        <div className="flex flex-col min-h-screen">
        <Header></Header>
            <main className="flex-grow p-4">
                <Main />
            </main>
            <Footer />
        </div> 
    );
};

export default App;
